import React from 'react'
import './navbar.css'
import day_logo from '../../assets/day.png'
import light_logo from '../../assets/night.png'
import dark_person from '../../assets/person_dark.png'
import light_person from '../../assets/person_light.png'


const Navbar=({theme,setTheme})=> {
    const toggle_mode=()=>{
        theme=='light'?setTheme('dark'):setTheme('light');
        console.log(theme);
    }
    
  return (
    <div className={`container ${theme}`}>Navbar
     <img src={theme=='light'? light_person :dark_person} alt="" className='toggle-icon'/>
     <img  onCanPlay={()=>{toggle_mode}} src={theme=='light'? light_logo:day_logo } alt="" className='toggle-icon'/>
    </div>

   
  )
}

export default Navbar
